import { Switch } from "react-router-dom";
import { Route} from "react-router-dom";
import { BrowserRouter } from "react-router-dom";

export const RoutesApp = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" Component={()=> <h1>ola</h1>} />
            </Switch>
        </BrowserRouter>
    );
};
